function trigger_anti_spam(msg,type)
if type == 'kick' then kick(msg,msg.chat_id_,msg.sender_user_id_) stormmonshn(msg.chat_id_, msg.sender_user_id_, msg.id_, '💥¦ العضو • ( '..msg.sender_user_id_..' ) قام بعمل تكرار في المجموعه وتم طرده' , 13, string.len(msg.sender_user_id_)) end if type == 'ban' then
if is_banned(msg.chat_id_,msg.sender_user_id_) then else stormmonshn(msg.chat_id_, msg.sender_user_id_, msg.id_, '💥¦ العضو • ( '..msg.sender_user_id_..' ) قام بعمل تكرار في المجموعه وتم حظره' , 13, string.len(msg.sender_user_id_)) end changeChatMemberStatus(msg.chat_id_, msg.sender_user_id_, "Kicked") :sadd(REBAR..'storm:baned'..msg.chat_id_,msg.sender_user_id_) end if type == 'mute' then
if is_muted(msg.chat_id_,msg.sender_user_id_) then else stormmonshn(msg.chat_id_, msg.sender_user_id_, msg.id_, '💥¦* العضو • ( '..msg.sender_user_id_..' ) قام بعمل تكرار في المجموعه وتم كتمه' , 13, string.len(msg.sender_user_id_)) end :sadd(REBAR..'mutes'..msg.chat_id_,msg.sender_user_id_) end end function televardump(msg,value) local text = json:encode(value) REBAR(msg.chat_id_, msg.id_, 1, text, 'html') end
